import React from 'react'
import Navigation from '../components/Navigation.js'

class Footer extends React.Component {
  render () {
    return (
        <div>
          <Navigation />
          <p>Moath Dlaimi 2020</p>
        </div>
    )
  }
}
export default Footer;
